import React, { useState, useEffect } from "react";
import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Modal from "@mui/material/Modal";
import { DataValue } from "./store/types";

const bull = (
  <Box
    component="span"
    sx={{ display: "inline-block", mx: "2px", transform: "scale(0.8)" }}
  >
    â€¢
  </Box>
);

export const Dashboard = (props: any): JSX.Element => {
  const { dashboardRequest, dashboardReducer } = props;
  const { dataRecords } = dashboardReducer;

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);
  const style = {
    position: "absolute" as "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: 400,
    bgcolor: "background.paper",
    border: "2px solid #000",
    boxShadow: 24,
    p: 4,
  };

  useEffect(() => {
    dashboardRequest();
  }, []);

  return (
    <Box sx={{ minWidth: 275, marginTop: 10 }}>
      <Grid container spacing={2}>
        {dataRecords.map((data: DataValue, index: number) => (
          <Grid item xs={12} key={index}>
            <Card variant="outlined">
              <CardContent>
                <Typography
                  sx={{ fontSize: 14, float: "right" }}
                  color="text.secondary"
                  gutterBottom
                >
                  Edit
                </Typography>
                <Typography variant="h5" component="div">
                  {data.title}
                </Typography>
                {/* <Typography sx={{ mb: 1.5 }} color="text.secondary">
                {data.userId}
                </Typography> */}
                <Typography variant="body2">{data.body}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <Typography id="modal-modal-title" variant="h6" component="h2">
            Text in a modal
          </Typography>
          <Typography id="modal-modal-description" sx={{ mt: 2 }}>
            Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
          </Typography>
        </Box>
      </Modal>
    </Box>
  );
};
